INSERT INTO UNSWSocietyEvents (fbEventsID, data__id, data__description, username, id, data__place__location__latitude, data__place__location__longitude, data__going, data__went, data__interested, data__name, data__Date, data__start_time, data__end_time, data__Time_From_To) VALUES (629, '626249567714189', 'Skills workshops aim to give students tips and information to assist them in various stages of the clerkship application process and will feature topics listed below. Workshops are delivered by representatives from a sponsor firm and hence are tailored to the application process of the presenting firm, but are relevant to job applications in general. Students can apply the skills they learn at these workshops in the clerkship application process and in their future careers.

Skills workshop topics are as follows, and are presented by the firms indicated:

- CV and Cover Letter (MinterEllison)
- Commercial Awareness (Allen &amp; Overy)
- Cover Letter (Baker McKenzie) 
- Generalist Q&amp;A (Herbert Smith Freehills)
- Infrastructure Law (Pinsent Masons)
- Interview (Ashurst)
- Personal Branding (Allens)
- Resilience (King &amp; Wood Mallesons)
- Wellbeing (Corrs Chambers Westgarth)

Please note that each event will occur at 1-2pm in the UNSW Law Building, please refer to the event details above for dates and room locations for individual skills workshops.', 'unswlawsoc', NULL, '-33.917180329607', '151.2279384663', '<span class="see_more_link_inner">See more</span></a></span></span></div></span></div></div><div class="_4-u2 _3-96 _4-u8"><div class="_4-u3 _2ph_ _62-2">Upcoming dates</div><div class="_4-u3"><div><div class="_62zy"><div class="clearfix _ikh"><div class="_4bl7 _4s8g _2pit"><span aria-label="24 May" class="_5x8v _5a4_ _5a5j" title="24 May"><span class="_5a4-">MAY</span><span class="_5a4z">24</span></span></div><div class="_4bl7 _1_41"><div class="_4s8a"><div class="_62pa">Thurs 13:00  14:00</div></div>8 people going</div><div class="_4bl9 _1_40"><div class="_5qwr _1pf1 _1_42 _2mga"><div><noscript id="u_0_1j"></noscript></div></div><div class="_2mga _1_42"><div class="_5qwr" id="event_button_bar"><div class="clearfix"><div class="lfloat _ohe"><div class="_1pf1 _5qwu"><a role="button" class="_42ft _4jy0 _i8v _4jy3 _517h _51sy" href="#" id="u_0_1k"><i class="_3-8_ _3-8_ img sp_mKbWz_ck_xH sx_be27fb"></i>Interested</a><a role="button" class="_42ft _4jy0 _i8v _4jy3 _517h _51sy" href="#" id="u_0_1l"><i class="_3-8_ _3-8_ img sp_-5UQgJ79515 sx_13c0a3"></i>Going</a></div></div><div class="_1pf1 rfloat _ohf"></div></div></div></div></div></div><a class="_2mg9" href="/events/626249567714189/?event_time_id=626249574380855&amp;acontext=%7B%22ref%22%3A%221%22%2C%22action_history%22%3A%22%5B%7B%5C%22surface%5C%22%3A%5C%22permalink%5C%22%2C%5C%22mechanism%5C%22%3A%5C%22upcoming_child_times%5C%22%2C%5C%22extra_data%5C%22%3A%5B%5D%7D%5D%22%7D">View event</a></div><div class="_62zy"><div class="clearfix _ikh"><div class="_4bl7 _4s8g _2pit"><span aria-label="31 May" class="_5x8v _5a4_ _5a5j" title="31 May"><span class="_5a4-">MAY</span><span class="_5a4z">31</span></span></div><div class="_4bl7 _1_41"><div class="_4s8a"><div class="_62pa">Thurs 13:00  