INSERT INTO UNSWSocietyEvents (fbEventsID, data__id, data__description, username, id, data__place__location__latitude, data__place__location__longitude, data__going, data__went, data__interested, data__name, data__Date, data__start_time, data__end_time, data__Time_From_To) VALUES (689, '251611618718011', 'Need to stop procrastinating? Need a quiet place to study? Need a motivation (and a WAM) booster?

UNSW SciSoc is proud to present STUDY SESSIONS!

We are providing a quiet and comfortable environment for you at uni to maximise your productivity and encourage you to help each other study. Lets ace finals together! 

There will be friendly supervisors to make sure you aren&#039;t getting distracted and cheer you on for those upcoming exams. You are welcome to bring friends along and study in groups! 

Hope to see you there :) 
______________________________________________________

WHO: All UNSW students welcome

WHEN: Wednesday 23rd and Thursday 24th of May (Week 12)- come and go as you please! 

DETAILS: 

 Wed 23rd May 

SESSON 1: 10am - 1pm &#064; Mathews 103

SESSION 2: 2pm - 5pm &#064; Civil Engineering 701

 Thurs 24th May 

SESSION 1: 10am - 1pm &#064; Red Centre M032

SESSION 2: 2pm - 5pm &#064; Civil Engineering 109

SNACKS: Snacks will be provided during the sessions.  

______________________________________________________

 PLEASE REGISTER HERE for catering purposes: https://goo.gl/forms/lWoPrYephHOdi9TN2 
______________________________________________________

DISCLAIMERS: 

1. A Maximum of 30 people can attend each session so it will be first come first served for spots.
2. All phones will need to be surrendered at the door in an effort to curtail any distractions. They will be returned upon departure. 
3. Quiet discussion only - no disruptive behaviour will be tolerated.

______________________________________________________

Have a question? Please send us a Facebook message or email us at scisoc.unsw&#064;gmail.com and we will be sure to get back to you ASAP.', 'unswscisoc', NULL, '-33.86637', '151.02375', '<span class="see_more_link_inner">See more</span></a></span></span></div></span></div></div><div class="_4-u2 _3-96 _4-u8"><div class="_4-u3 _2ph_ _62-2">Upcoming dates</div><div class="_4-u3"><div><div class="_62zy"><div class="clearfix _ikh"><div class="_4bl7 _4s8g _2pit"><span aria-label="23 May" class="_5x8v _5a4_ _5a5j" title="23 May"><span class="_5a4-">MAY</span><span class="_5a4z">23</span></span></div><div class="_4bl7 _1_41"><div class="_4s8a"><div class="_62pa">Wed 10:00  17:00</div></div>8 people going</div><div class="_4bl9 _1_40"><div class="_5qwr _1pf1 _1_42 _2mga"><div><noscript id="u_0_1k"></noscript></div></div><div class="_2mga _1_42"><div class="_5qwr" id="event_button_bar"><div class="clearfix"><div class="lfloat _ohe"><div class="_1pf1 _5qwu"><a role="button" class="_42ft _4jy0 _i8v _4jy3 _517h _51sy" href="#" id="u_0_1l"><i class="_3-8_ _3-8_ img sp_mKbWz_ck_xH sx_be27fb"></i>Interested</a><a role="button" class="_42ft _4jy0 _i8v _4jy3 _517h _51sy" href="#" id="u_0_1m"><i class="_3-8_ _3-8_ img sp_-5UQgJ79515 sx_13c0a3"></i>Going</a></div></div><div class="_1pf1 rfloat _ohf"></div></div></div></div></div></div><a class="_2mg9" href="/events/251611618718011/?event_time_id=251611622051344&amp;acontext=%7B%22ref%22%3A%221%22%2C%22action_history%22%3A%22%5B%7B%5C%22surface%5C%22%3A%5C%22permalink%5C%22%2C%5C%22mechanism%5C%22%3A%5C%22upcoming_child_times%5C%22%2C%5C%22extra_data%5C%22%3A%5B%5D%7D%5D%22%7D">View event</a></div><div class="_62zy"><div class="clearfix _ikh"><div class="_4bl7 _4s8g _2pit"><span aria-label="24 May" class="_5x8v _5a4_ _5a5j" title="24 May"><span class="_5a4-">MAY</span><span class="_5a4z">24</span></span></div><div class="_4bl7 _1_41"><div class="_4s8a"><div class="_62pa">Thurs 10:00  17:00</div></div>7 people going</div><div class="_4b