INSERT INTO UNSWSocietyEvents (fbEventsID, data__id, data__description, username, id, data__place__location__latitude, data__place__location__longitude, data__going, data__went, data__interested, data__name, data__Date, data__start_time, data__end_time, data__Time_From_To) VALUES (699, '174600729921615', 'Join fellow French cinephiles for a film, fingerfood and cocktail for $25!
Film: C&#039;est la vie! / Le Sens de la fte (2017)
Over more than 30 years, Max (Jean-Pierre Bacri) has enjoyed a celebrated career as a caterer and event organiser. As per usual, Max has everything precisely organised for Pierre and Hlnas nuptials but, as the celebrations get underway, Murphys Law takes over, and his perfectly planned occasion risks disintegrating into a chaotic farce.

Trailer: https://www.youtube.com/watch?v=ErV26mIdEvU', 'uowfrenchsociety', NULL, '-34.426245141', '150.89516945605', 0, '1', '12', 'French Film Festival (Friday)', '18 May', '18:00', '21:30', '0');
INSERT INTO UNSWSocietyEvents (fbEventsID, data__id, data__description, username, id, data__place__location__latitude, data__place__location__longitude, data__going, data__went, data__interested, data__name, data__Date, data__start_time, data__end_time, data__Time_From_To) VALUES (700, '518919685176502', 'Chris Sidoti is an international human rights consultant, specialising in the international human rights system and in national human rights institutions. 

Currently, Chris Sidoti is a part of the the United Nations Independent International Fact-Finding Mission to establish the facts and circumstances of the alleged human rights violations by military and security forces, and abuses, in Myanmar, in particular in Rakhine State, with a view to ensuring full accountability for perpetrators and justice for victims.

In this talk, Mr Sidoti will discuss the evidence gathered in the series of missions to Bangladesh, Malaysia and Thailand, the responses of the UN system to the crisis, the urgent need in the refugee camps as monsoon season approaches - and the way forward from here. The Fact-Finding Mission will present its final report to the Human Rights Council in September.', 'DTPHumanRights', NULL, '-33.917180329607', '151.2279384663', '1', 0, '5', 'DTP &amp; AHRI Udhr70 Discussion Series: Chris Sidoti', '25 May', '12:00', '13:30', '0');
