Location: KWM, Level 61 Governor Phillip Tower, 1 Farrer Place
Dress Code: Smart Casual 

If you have any questions, please contact julie.wong&#064;unswlawsoc.org', 'unswlawsoc', NULL, '-33.864057989578', '151.21124558411', '23', 0, '50', 'King &amp; Wood Mallesons Firm Breakfast', '28 May', '8:00', '9:30', '0');
