INSERT INTO UNSWSocietyEvents (fbEventsID, data__id, data__description, username, id, data__place__location__latitude, data__place__location__longitude, data__going, data__went, data__interested, data__name, data__Date, data__start_time, data__end_time, data__Time_From_To) VALUES (703, '1282710928540576', 'Dr Francisco Mojica, who discovered the unusual repeated DNA sequences at the core of todays gene-editing revolution, will be joined in conversation with Merlin Crossley, Professor of Molecular Biology and Deputy Vice-Chancellor (Academic) at UNSW Sydney. 

Dont miss your chance to join these two scientific luminaries as they explore the history of CRISPR, from Mojicas ground-breaking discovery to the genome-editing technique that could potentially cure diseases like sickle cell anaemia, muscular dystrophy, and HIV.', 'UNSWGrandChallenges', NULL, '-33.9166', '151.22725', 0, 0, 0, 'The pioneer of Crispr: In conversation with Francisco Mojica', '12 June', '18:30', '19:30', '0');
