Buxton Play Group will be joined today, with the Dilly Wanderer (Wollondilly Council&#039;s mobile &#039;play van&#039;). Lots of craft, art, games and fun to be had.

BUXTON PLAYGROUP DETAILS:

Every Wednesday morning from 9.30am, Buxton Play Group meets in the School of Arts community hall for lots of fun together (22 West Pde Buxton). 

Everyone is welcome, even if you don&#039;t live in Buxton. We are very friendly and inclusive.

BRING:

* Gold Coin Donation to cover the cost of the hall hire - helps to keep our community owned hall open.

* Some fruit or a healthy snack for the children to share together. Please do not bring any food containing nuts as we have children who attend with nut allergies. 

PARKING:
Car parking area is located across the road from the hall on the nature strip next to the old Buxton Station, the driveway entrance is across the road from the Rural Fire Service Shed. Please note this is a unsealed dirt road.

CONTACT:

For questions please leave a Facebook message or you can contact Nicole 0433 859 558.', 'buxtonplaygroup', NULL, '-34.255354229768', '150.53286552429', '2', 0, '1', 'Buxton Play Group &amp; The Dilly Wanderer', '23 May', '9:30', '11:00', '0');
