INSERT INTO UNSWSocietyEvents (fbEventsID, data__id, data__description, username, id, data__place__location__latitude, data__place__location__longitude, data__going, data__went, data__interested, data__name, data__Date, data__start_time, data__end_time, data__Time_From_To) VALUES (734, '441854092940732', 'Moneylife Foundations RTI Centre is conducting a Panel Discussion on Right to Information: A Constitutional Right with Shailesh Gandhi, Dr Anupam Saraph, Adv Jamshed Mistry and Sucheta Dalal.

Speaker: Prof M Sridhar Acharyulu, Central Information Commissioner

Guest of Honour: Mr Prithviraj Chavan, Former Chief Minister of Maharashtra.

Panelists:

Shailesh Gandhi, Former Central Information Commissioner.
Dr Anupam Saraph, Expert in designing sustainable systems.
Adv Jamshed Mistry, Bombay High Court.

Moderator: Sucheta Dalal, Trustee-Moneylife Foundation

Date &amp; Time: 26th May 2018 (Saturday); 4pm to 6pm.

Venue: Mini-theatre, 3rd floor, Pu La Deshpande Maharashtra Kala Academy, near Siddhivinayak temple, Sayani Road, Prabhadevi, Mumbai   400025.
Registration

Entry is free but Registration is mandatory.

Alternatively you can also register your name, email-id and contact number on 022-49205000 or email foundation&#064;moneylife.in or Call/SMS/WhatsApp on +91-7045156415.
Contact

For any queries, contact:
Shilpa Raut: +91-7045156415
Shrikrishna Kachave: +91- 8796655413

Moneylife Foundations RTI Centre is a project started with an aim to bring transparency and accountability in the governance and administrative system of the country. Its objective is to inspire active participation of citizens in democracy.', 'DebSocSOEL', NULL, '19.0621', '72.8764', '0', 0, '3', 'Panel Discussion on Right to Information: A Constitutional Right', '26 May', 0, 0, '0');
