INSERT INTO UNSWSocietyEvents (fbEventsID, data__id, data__description, username, id, data__place__location__latitude, data__place__location__longitude, data__going, data__went, data__interested, data__name, data__Date, data__start_time, data__end_time, data__Time_From_To) VALUES (736, '461944230906807', 'Hey guys! For anyone who has been dying to run a 14km charity race but didn&#039;t know where to go, look no further!!
 
-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\
Event Details
-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\
When:
Sunday, August 12, 2018
 
Why:
It&#039;s a chance to get fit, have fun and if you want, raise some money for the Cancer Council (or other charity) while you&#039;re at it
 
Who:
Anyone in CEVSOC can come, and please invite your friends.
Don&#039;t worry if you haven&#039;t done anything like this before, we are all a little unfit and we will need some training to get ready!
 
Cost:
$67 (entry before May 29) or $77 (entry before July 24)
 
Training:
We are planning to do some (non-compulsory, but highly recommended) training at uni. Depending on how many people are coming we may do 2 days a week (Tuesday, Thursday 6pm) or more if we get enough people
 
Food/Drinks After the Race:
Definitely!!
Location - TBD
 
 
-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\
Registration
-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-
1. Go to the City2Surf URL: http://city2surf.com.au/
2. On the top right corner click enter now
3. Select 14km. Next to Adult, click select and click join team
4. The team name is &quot;CEVSOC&quot;
5. The password is &quot;RunForrestRun&quot;
6. When you are asked to select the Start Group select &quot;Westpac Yellow Start (Runners/Joggers)&quot;
 
-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-
Fundraising
-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-\-
1. Create your own profile. It is recommended to choose &quot;Cancer Council NSW&quot; as your fundraising charity just so we can all work together to raise money for one charity.
2. Go to the CEVSOC Fundraising URL: https://city2surf2018.everydayhero.com/au/CEVSOC
3. Click Join team
4. Anytime you receive donations, they will appear here to. You can compare who has raised the most money, just so you know how much you need to raise to beat your friends :D', 'cevsoc', NULL, '-33.917010287581', '151.23047590256', '11', 0, '41', 'CEVSOC Presents: City2Surf', '12 August', '8:30', '12:00', '0');
