INSERT INTO UNSWSocietyEvents (fbEventsID, data__id, data__description, username, id, data__place__location__latitude, data__place__location__longitude, data__going, data__went, data__interested, data__name, data__Date, data__start_time, data__end_time, data__Time_From_To) VALUES (816, '201772423882617', 'UNSW Surgsoc presents the annual Bowel Anastomosis Workshop - a special event that will surely colon your surgical repertoire. 

This not-to-be-missed workshop serves as a &quot;how to&quot; for end-to-end, end-to-side and side-to-side rejoining of cut bowel. A consultant colorectal surgeon has been invited to talk about when and why bowel anastamosis is required, and will run through step-by-step instructions on the procedure and demonstrate. There are thirty spots available  get in quick! 

Registration will open Tuesday 15th May at 6:30PM. A link will be posted onto this event page, so please click attending to receive notifications about the event. Spots are limited to 30 and will be on a first come, first served basis. You must be a UNSW Medical student who has attended at least one UNSW Surgsoc Suturing Workshop and fill in the registration form with correct contact details to qualify for a successful registration.

The workshop will cost $15 to cover the cost of the materials. An email will be sent after registration is successful with payment details. 

Please note that your place in a workshop will not be confirmed until full payment is received at least 24 hours before the event. If you have registered and paid you will not be eligible for a refund under any circumstances.', 'unswsurgicalsociety', NULL, '-33.91927', '151.2320499', 0, '30', '131', 'UNSW Surgsoc: Bowel Anastomosis Workshop', '22 May', '17:30', '20:00', '0');
