INSERT INTO UNSWSocietyEvents (fbEventsID, data__id, data__description, username, id, data__place__location__latitude, data__place__location__longitude, data__going, data__went, data__interested, data__name, data__Date, data__start_time, data__end_time, data__Time_From_To) VALUES (823, '470191753411643', 'Start of BREAK always feel great, no assignments, no tutors, no more never-ending stairs on campus. Though we do miss the company of our mates from university, so why not make your big event after this tiring semester a lit one. Come join ARCHSOC for a time to test your drinking limits and forget about all your studio designs from the tragic first semester. 

