-- Table: UserSociety
CREATE TABLE UserSociety (UserSocietyID INTEGER PRIMARY KEY AUTOINCREMENT UNIQUE NOT NULL, userID VARCHAR (15), fbEventsID INTEGER, Date DATE DEFAULT (strftime('%d/%m/%Y', 'now')) NOT NULL);

-- View: vwUNSWSocietyEventsAbout
CREATE VIEW vwUNSWSocietyEventsAbout AS SELECT UNSWse.fbEventsID,
       UNSWse.data__id,
       UNSWse.data__description,
       UNSWse.username,
       UNSWse.id,
       UNSWse.data__place__location__latitude,
       UNSWse.data__place__location__longitude,
       UNSWse.data__going,
       UNSWse.data__went,
       UNSWse.data__interested,
       UNSWse.data__name,
       UNSWse.data__Date,
       UNSWse.data__start_time,
       UNSWse.data__end_time,
       UNSWse.data__Time_From_To,
       UNSWsa.username,
       UNSWsa.id,
       UNSWsa.about,
       UNSWsa.fan_count,
       UNSWsa.website,
       UNSWsa.cover__cover_id,
       UNSWsa.cover__offset_x,
       UNSWsa.cover__offset_y,
       UNSWsa.cover__source,
       UNSWsa.cover__id,
       UNSWsa.link,
       UNSWsa.emails,
       UNSWsa.founded
  FROM UNSWSocietyEvents UNSWse
  JOIN UNSWSocietyAbout UNSWsa 
  ON UNSWse.username = UNSWsa.username
  ORDER BY  cast(UNSWse.data__going as int) desc;

-- View: vwUserSociety
CREATE VIEW vwUserSociety AS SELECT USA.*,
       US.*,
       fbe.*
FROM UserSociety US
JOIN UNSWSocietyEvents fbe
ON US.fbEventsID = fbe.fbEventsID
JOIN UNSWSocietyAbout USA
ON fbe.username  = USA.username;

COMMIT TRANSACTION;
PRAGMA foreign_keys = on;
